  width: 130px;
  padding: 10px;
  border: 2px solid #333;
  border-radius: 4px;
  color: #333;
  font-size: 16px;
  font-weight: 700;
  text-align: center;
  cursor: pointer;
  box-sizing: border-box;
  display: block;
  transition: 0.4s;
  &:hover {
    background-color: #333;
    color: #fff;
  }
  &.btn--reverse {
    background-color: #333;
    color: #fff;
    &:hover {
      background-color: transparent;
      color: #333;
    }
  }
  &.btn--brown {
    color: #592b18;
    background-color: #fff;
    &:hover {
      color: #fff;
      background-color: #592b18;
    }
  }
  &.btn--gold {
    color: #d9aa8a;
    background-color: #fff;
    &:hover {
      color: #fff;
      background-color: #d9aa8a;
    }
  }
  &.btn--white {
    color: #fff;
    background-color: #fff;
    &:hover {
      color: #333;
      background-color: #fff;
    }
  }
}

/* HEADER */
header {
  width: 100%;
  background-color: #f6f5f0;
  border-bottom: 1px solid #c8c8c8;
  position: fixed;
  top: 0;
  z-index: 999;
  > .inner {
    height: 120px;
  }
  .logo {
    height: 75px;
    position: absolute;
    top: 0;
    bottom: 0;
    left: 0;
    margin: auto;
    // display: none;
  }
  .sub-menu {
    position: absolute;
    top: 10px;
    right: 0;
    display: flex;
    ul.menu {
      font-family: Arial, sans-serif;
      display: flex;
      li {
        position: relative;
        &::before {
          content: '';
          display: block;
          width: 1px;
          height: 12px;
          background-color: #e5e5e5;
          position: absolute;
          top: 0;
          bottom: 0;
          margin: auto;
        }
        &:first-child::before {
          display: none;
        }
        a {
          font-size: 12px;
          padding: 11px 16px;
          display: block;
          color: #656565;
          &:hover {
            color: #000;
          }
        }
      }
    }
    .search {
      height: 34px;
      position: relative;
      input {
        width: 36px;
        height: 34px;
        padding: 4px 10px;
        border: 1px solid #ccc;
        box-sizing: border-box;
