        }
      }
      &.focused {
        .material-icons {
          opacity: 0;
        }
      }
      .material-icons {
        height: 24px;
        position: absolute;
        top: 0;
        bottom: 0;
        right: 5px;
        margin: auto;
        transition: 0.4s;
      }
    }
  }
  .main-menu {
    position: absolute;
    bottom: 0;
    right: 0;
    display: flex;
    z-index: 1;
    .item {
      .item__name {
        padding: 10px 20px 34px 20px;
        font-family: Arial, sans-serif;
        font-size: 13px;
      }
      .item__contents {
        width: 100%;
        position: fixed;
        left: 0;
        display: none;
        .contents__menu {
          background-color: #2c2a29;
          > ul {
            display: flex;
            padding: 20px 0;
            > li {
              width: 220px;
              h4 {
                padding: 3px 0 12px 0;
                font-size: 14px;
                color: #fff;
              }
              > ul {
                > li {
                  padding: 5px 0;
                  font-size: 12px;
                  color: #999;
                  cursor: pointer;
                  &:hover {
                    color: #669900;
                  }
                }
              }
            }
          }
        }
        .contents__texture {
          padding: 26px 0;
          font-size: 12px;
          background-image: url('../images/main_menu_pattern.jpg');
          .inner {
            > h4 {
              color: #999;
              font-weight: 700;
            }
            > p {
              color: #669900;
              margin: 4px 0 14px;
            }
          }
        }
      }
      &:hover {
        background-color: #2c2a29;
        color: #669900;
        border-radius: 6px 6px 0 0;
      }

      &:hover .item__contents {
        display: block;
      }
    }
  }
  .badges {
    position: absolute;
    top: 132px;
    right: 12px;
    .badge {
      border-radius: 10px;
      overflow: hidden;
      margin-bottom: 12px;
      box-shadow: 4px 4px 10px rgba(0, 0, 0, 0.15);
      cursor: pointer;
    }
  }
